import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import App from './App'

class LoadingBar extends Component {

  render() {
    var loadingbar = <div className="bar_container"><div className="bar"></div></div>;
    return (
      <div className="progress_bar day">
        <label>{this.state.YearPercentage}</label><br></br>
        <label>{this.state.WeekPercentage}</label><br></br>
        <label>{this.state.DayPercentage}</label>
        {loadingbar}
      </div>
    );
  }
}

export default App;
